import React, {useState, useEffect} from "react";

function Match() {

  const [match, setMatch] = useState({});

  useEffect(
    () => {
      const fetchMatches = async () => {

        const responce = fetch("http://localhost:8081/dashboard/latestMatchTeam?team=Mumbai Indians");
        const obj = await responce.json();
        setMatch(obj);

      }

      fetchMatches;

    },[]
  );

    return (
      <div className="matchPage">
        <h2>Match Page</h2>
        <h4>{match}</h4>
      </div>
    );
  }

  export default Match;
